    to: { width: "600px", minHeight: "100vh" },
    from: {
      height: "400px",
      width: "400px",
      backgroundColor: "black",
      position: "absolute",
      top: 0,
      right: 0,
    },
  });
  return (
    <div
      style={{
        height: "400px",
        width: "400px",
        backgroundColor: "black",
        position: "absolute",
        top: 0,
              right: 0,
        zIndex
      }}
    ></div>
  );
}

export default LikeBar;
